import React from "react";
import NavBar from "./components/UI/NavBar";
import Glowna from "./components/Strony/Glowna";
import OfertaHandler from "./components/Strony/Oferta";
import KontaktHandler from "./components/Strony/Kontakt";
import {Route, Routes} from 'react-router-dom';
function App() {


  return (
    <div>
      <NavBar />
      <Glowna />
      <div> 
        <Routes>
          <Route path='./Glowna' element={<Glowna/>}></Route>
          <Route path='./Oferta' element={<OfertaHandler/>}></Route>
          <Route path='./Kontakt' element={<KontaktHandler/>}></Route>
        </Routes>
         </div>

    </div>

  );
}

export default App;
